
import base64
from io import BytesIO
from PIL import Image

from word_detect import WordDetector
from siamese_predict import Siamese
from gen_word_img import generate_character_image

class CaptchaLocator(object):

    def __init__(self, **kwargs):
        self.word_detector = WordDetector()
        self.siamese = Siamese()


    def run(self, image_base64, words):

        if image_base64.startswith('data:image'):
            image_base64 = image_base64.split(',')[1]
        image = base64.b64decode(image_base64)

        positions = self.word_detector.detect(image)

        image = Image.open(BytesIO(image))

        targets = []
        for position in positions:
            img = image.crop(tuple(position))
            targets.append(img)

        results = []
        for word in words:
            word_image = generate_character_image(word)
            similarity_max = 0
            position_max = []
            for i, target in enumerate(targets):
                similarity = self.siamese.detect_image(word_image, target)
                if similarity > similarity_max:
                    similarity_max = similarity
                    position_max = positions[i]
            results.append(position_max)

        return results




if __name__ == "__main__":

    locator = CaptchaLocator()

    img_base64 = "data:image/png;base64,"


    import time

    start_time = time.time()
    results = locator.run(img_base64, ['者', '天', '治'])
    end_time = time.time()

    print(f"运行时间: {end_time - start_time:.4f} 秒")

    print(results)

